import React, { Component } from 'react'

class Contact extends Component {
    render() {
        const {name,email,phone}    =   this.props;
        return (
            <div>
                <h4>{name}</h4>
                <ul>
                    <li>{email}</li>
                    <li>{phone} </li>
                </ul>
            </div>
        )
    }
}


Header.defaultProps={
    branding:PropTypes.string.isRequired
}

export default Contact;
